import React from 'react';
import Radio from '@material-ui/core/Radio';


export default function RadioUi(props) {

    return (
            <Radio
                onChange={props.onChange}
                value={props.value}
                name={props.name}
                inputProps={{ 'aria-label': 'B' }}
            />
    );
}
